      "request": "Get to know your legal rights under the Military Lending Act (MLA).",
      "response": "The MLA is a federal law designed to protect Service members and their families from predatory lending practices by providing safeguards when obtaining certain types of consumer credit."
    },
    {
      "request": "What are the covered loans under the MLA?",
      "response": "Covered loans under the MLA include payday loans, credit cards, vehicle title loans, refund anticipation loans, certain installment loans, and certain student loans."
    },
    {
      "request": "What are the benefits offered under the MLA?",
      "response": "Benefits offered under the MLA include an interest rate cap of 36% on certain loans, prohibition of mandatory arbitration, no prepayment penalties, accurate disclosures, identification of Service members, no mandatory allotments, and protection from waiver of rights."
    },
    {
      "request": "Does the MLA apply to loans secured by the property being purchased?",
      "response": "No, the MLA generally does not apply to loans secured by the property being purchased, such as residential mortgages, vehicle loans, and secured personal property loans like those for home appliances."
    },
    {
      "request": "What is the Military Lending Act?",
      "response": "The Military Lending Act is a federal law that provides legal rights and protections to Service members and their families, including an interest rate cap, prohibition of mandatory arbitration, and requirements for lenders to disclose all applicable disclosures."
    },
    {
      "request": "What is the Servicemembers Civil Relief Act (SCRA)?",
      "response": "The Servicemembers Civil Relief Act (SCRA) is a federal law that provides legal protections to Service members, including protections against default judgments and eviction, but it is not the same as the Military Lending Act."
    }
  ]
}

